from functools import cache
from typing import List

class Solution:
    def maximumScore(self, nums: List[int], multipliers: List[int]):
        m = len(multipliers)
        n = len(nums)
        
        res = [[0 for _ in range(m+1)] for __ in range(m+1)]
        for i in range(m-1, -1, -1):
            for j in range(i+1):
                # print(i, j, n-i+j-1)
                # print(multipliers[i] * nums[n-i+j-1] + res[i+1][j])
                res[i][j] = max(
                    multipliers[i] * nums[j] + res[i+1][j+1],
                    multipliers[i] * nums[n-i+j-1] + res[i+1][j]
                )
        return res[0][0]

